import { SET_ACTIVE_WELL } from "../ActionCreators/types"

// const INITIAL_STATE = {

// }

export default (state, action) => {
  switch (action.type) {
    case SET_ACTIVE_WELL:
      return {...state, action}
    default:
      return state;
  }
}
